import React from "react";
import Button from "@material-ui/core/Button";

class Assets extends React.Component {
  constructor(){
    super()
    this.state = {
      name: "",
      price: ""
    }
  }

  changeMyName(){
    this.setState({
      name: "Ryan"
    })
  }

  render() {
  return(
    <div>
      <h1>Assets</h1>
      <Button>Add Assets</Button>
      <h1>{this.state.name, 0}</h1>
    </div>
    )
  }
}
export default Assets
